CREATE TABLE IF NOT EXISTS "api_keys" (
	"id" serial NOT NULL,
	"type" "api_key_type",
	"content" text
);

CREATE TABLE IF NOT EXISTS "editors" (
	"id" serial NOT NULL,
	"content" jsonb DEFAULT '{}'::jsonb NOT NULL,
	"created_at" timestamp DEFAULT now() NOT NULL,
	"updated_at" timestamp with time zone
);
